SELECT * FROM (SELECT * FROM (SELECT c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment FROM (select * from customer where ((c_custkey >= 9376) AND (c_custkey < 18752)) OR ((c_custkey >= 32816) AND (c_custkey < 46880)) OR ((c_custkey >= 51568) AND (c_custkey < 56256)) OR ((c_custkey >= 65632) AND (c_custkey < 70320)) OR ((c_custkey >= 75008) AND (c_custkey < 79695)) OR ((c_custkey >= 84382) AND (c_custkey < 93756)) OR ((c_custkey >= 103130) AND (c_custkey < 112504)) OR ((c_custkey >= 121878) AND (c_custkey < 131252)) OR ((c_custkey >= 140626) AND (c_custkey < 145313))) cc, (select * from orders where ((o_orderkey >= 1) AND (o_orderkey < 374982)) OR ((o_orderkey >= 562497) AND (o_orderkey < 1687491)) OR ((o_orderkey >= 2437479) AND (o_orderkey < 4687491)) OR ((o_orderkey >= 4874982) AND (o_orderkey < 5249988)) OR ((o_orderkey >= 5437479) AND (o_orderkey < 6000001))) oo, (select * from lineitem where ((l_orderkey >= 1) AND (l_orderkey < 375301)) OR ((l_orderkey >= 562278) AND (l_orderkey < 1687907)) OR ((l_orderkey >= 2438022) AND (l_orderkey < 4687457)) OR ((l_orderkey >= 4875014) AND (l_orderkey < 5250567)) OR ((l_orderkey >= 5437926) AND (l_orderkey < 6000001))) ll, nation WHERE c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= '1994-12-01' and o_orderdate < '1995-03-01'and l_returnflag = 'R' and c_nationkey = n_nationkey GROUP BY c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment) o1 ORDER BY revenue desc) o2 limit 20;
